import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import About from './About';
import Gallery from './Gallery';
import FAQ from './FAQ';
import './App.css';

const EVENTS = [
  {
    date: new Date(2025, 3, 28),
    title: 'Spring Bash',
    description: 'Kick off the season with our Spring Bash! Music, drinks, and fun all night.',
    location: 'Club XYZ',
  },
  {
    date: new Date(2025, 4, 5),
    title: 'VIP Night',
    description: 'Exclusive VIP event with special guests and performances.',
    location: 'Club XYZ',
  },
];

function App() {
  const [form, setForm] = useState({ name: '', phone: '', event: '' });

  const handleFormChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleRSVP = (e) => {
    e.preventDefault();
    const message = `Hi, I want to RSVP for ${form.event}! My name is ${form.name}, phone: ${form.phone}`;
    const whatsappNumber = 'YOUR_WHATSAPP_NUMBER'; // Replace with your WhatsApp number (with country code, e.g., 911234567890)
    const url = `https://wa.me/${whatsappNumber}?text=${encodeURIComponent(message)}`;
    window.open(url, '_blank');
  };

  const upcomingEvents = EVENTS.filter(ev => ev.date >= new Date());

  return (
    <Router>
      <div className="App">
        <nav className="main-nav">
          <Link to="/">Home</Link>
          <Link to="/about">About Us</Link>
          <Link to="/gallery">Gallery</Link>
          <Link to="/faq">FAQ</Link>
        </nav>
        <header className="brand-header">
          <img src="/logo.png" alt="Club Logo" className="logo" />
          <h1>Club Promotions</h1>
          <p>Experience the best events in town. Join us for unforgettable nights!</p>
        </header>
        <Routes>
          <Route path="/" element={
            <>
              <section className="calendar-section">
                <h2>Upcoming Events</h2>
                <div className="events-list">
                  {upcomingEvents.length === 0 ? (
                    <p>No upcoming events. Stay tuned!</p>
                  ) : (
                    <ul>
                      {upcomingEvents.map(ev => (
                        <li key={ev.title}>
                          <strong>{ev.title}</strong> - {ev.date.toDateString()}<br />
                          <em>{ev.location}</em><br />
                          <span>{ev.description}</span>
                        </li>
                      ))}
                    </ul>
                  )}
                </div>
              </section>
              <section className="rsvp-section">
                <h2>RSVP Now</h2>
                <form className="rsvp-form" onSubmit={handleRSVP}>
                  <input
                    type="text"
                    name="name"
                    placeholder="Your Name"
                    value={form.name}
                    onChange={handleFormChange}
                    required
                  />
                  <input
                    type="tel"
                    name="phone"
                    placeholder="Phone Number"
                    value={form.phone}
                    onChange={handleFormChange}
                    required
                  />
                  <select name="event" value={form.event} onChange={handleFormChange} required>
                    <option value="">Select Event</option>
                    {upcomingEvents.map(ev => (
                      <option key={ev.title} value={ev.title}>{ev.title} ({ev.date.toDateString()})</option>
                    ))}
                  </select>
                  <button type="submit">RSVP via WhatsApp</button>
                </form>
              </section>
            </>
          } />
          <Route path="/about" element={<About />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/faq" element={<FAQ />} />
        </Routes>
        <footer className="footer">
          <p>&copy; 2025 Club Promotions. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
